import React from 'react';

const Navbar = ({types}) => {
    return (
        <div>
            {types.map((item) => {
                return (
                    <div>
                        <img src={item.img} />
                        <p>{item.name}</p>
                        <p>Price: {item.price}</p>
                        <p>Rating: {item.rating}</p>
                    </div>
                )
            })}
        </div>
    );
};

export default Navbar;
